#%% import librariesimport numpy as npimport matplotlib.pyplot as pltimport pandas as pdimport skfuzzy as fuzz#%% Importing the datasetdataset = pd.read_csv('clustering/pcs.csv', index_col=0)X = dataset.valuesnames = dataset.index#%% Find optimal number of clustersfpcs = []for ncenters in range(2, 20):    print(ncenters)    cntr, u, u0, d, jm, p, fpc = fuzz.cluster.cmeans(        X, ncenters, 2, error=0.005, maxiter=1000, init=None)    # Store fpc values for later    fpcs.append(fpc)plt.plot(range(2, 20), fpcs)plt.title('The Elbow Method')plt.xlabel('Number of clusters')plt.ylabel('FPC')plt.show()#%% print cluster centers